import React from 'react';
import './Projects.css'; // Assurez-vous de créer ce fichier CSS pour le style

// Définissez vos projets sous forme de tableau d'objets
const projects = [
  {
    id: 1,
    title: 'Projet 1',
    subtitle: 'Description du Projet 1',
    image: 'logo512.png',
    link: '/projet1' // Lien vers les détails du projet
  },
  {
    id: 2,
    title: 'Projet 2',
    subtitle: 'Description du Projet 2',
    image: 'url_de_votre_image_2.jpg',
    link: '/projet2'
  },
  {
    id: 3,
    title: 'Projet 3',
    subtitle: 'Description du Projet 2',
    image: 'public/logo512.png.jpg',
    link: '/projet2'
  },
  {
    id: 4,
    title: 'Projet 4',
    subtitle: 'Description du Projet 2',
    image: 'url_de_votre_image_2.jpg',
    link: '/projet2'
  },
  {
    id: 5,
    title: 'Projet 5',
    subtitle: 'Description du Projet 2',
    image: 'url_de_votre_image_2.jpg',
    link: '/projet2'
  },
  {
    id: 6,
    title: 'Projet 6',
    subtitle: 'Description du Projet 2',
    image: 'url_de_votre_image_2.jpg',
    link: '/projet2'
  },
  {
    id: 6,
    title: 'Projet 6',
    subtitle: 'Description du Projet 2',
    image: 'url_de_votre_image_2.jpg',
    link: '/projet2'
  }
  // Ajoutez autant de projets que nécessaire
];

function Projects() {
  return (
    <div className="projects-container">
      {projects.map(project => (
        <div key={project.id} className="project-thumbnail">
          <div className="thumbnail-image">
            <img src={project.image} alt={project.title} />
          </div>
          <div className="project-details">
            <h3>{project.title}</h3>
            <p>{project.subtitle}</p>
            <a href={project.link} className="project-link">Voir plus</a>
          </div>
        </div>
      ))}
    </div>
  );
}

export default Projects;
